import React from 'react';
import Container from '@material-ui/core/Container';

function Footer() {
  return (
    <Container
      maxWidth="lg"
      style={{ backgroundColor: '#d7ffed82', textAlign: 'center' }}
    >
      <div style={{ padding: 50, backgroundColor: 'grey', color: '#151515' }}>
        App created by Vanessa Salvador{' '}
      </div>
    </Container>
  );
}

export default Footer;
